import React from 'react';
import TextField from '@mui/material/TextField';
import SendIcon from '@mui/icons-material/Send';
import './textbox.css';

const MyTextBox = () => {
  return (
    <div className='textbox-container'>
      <TextField
        className='box'
        multiline
        label="Enter Text"
        InputProps={{
          style: {
            color: 'white',
            width: '400%', // Adjust the width percentage or use a specific width value
            border: '1px solid white',
            borderRadius: '8px',
            padding: '8px',
          },
          endAdornment: (
            <SendIcon
              style={{
                position: 'absolute',
                right: 8,
                cursor: 'pointer',
                pointerEvents: 'auto',
                color: 'white',
              }}
              onClick={() => {
                console.log('Sending...');
              }}
            />
          ),
        }}
      />
    </div>
  );
};

export default MyTextBox;
